import React from "react";

const PremiereConst = props => (
    <div>
        <p>Vient de ma première constante</p>
    </div>
)
class PremiereClasse extends React.Component {
    render(){
        return <p> Vient de ma première classe </p>
    }
}
export default PremiereClasse;
